import React from 'react';

export default function NavBar() {
    return (
        <>
                    <Route exact path="/contact" element={<Contact />}></Route>
        <Route exact path="/itemmanager" element={<ItemManager />}></Route>
        <Route exact path="/viewitemdetail" element={<ViewItemDetail />}></Route>
        </>
    );
}
